import React from "react";
import "./Product.css";

function Product() {
  return (
    <div className="product">
      <div className="product-info">
        <p className="product-title">The Lean Startup</p>
        <p className="product-price">
          <small>$</small>
          <strong>9.99</strong>
        </p>
      </div>
      <img src="" alt="Image of product" className="product-image" />

      <button className="product-button">Add To Basket</button>
    </div>
  );
}

export default Product;
